//2.Escribir un programa para mostrar numeros primos entre dos números
//donde obtienes del usuario las 2 entradas del rango.
public class TablaMultiplicacion {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int   	multiplica=5;
		for (int i = 1; i <= 10; i++) {
            System.out.println("i: " + i*multiplica);
            
        }
		
	}

}
